import styled from "styled-components";

export const HeaderContainer = styled.div`
  height: 70px;
  width: 100%;
  display: flex;
  justify-content: space-between;
  margin-top: 10px;
`
export const LogoLink = styled()`
  height: 100%;
  width: 70px;
  padding: 25px;
`;
